import React from "react";
import RadioButtonGroups from "./RadioButtonGroups";

const ReviewItem = ({ index, review }) => {

  const removeReview = (e) => {
        e.preventDefault();
        e.stopPropagation();
    }

  return (
    <li>


      <div className={"labelContent" + (review.is_labeled ? " labeled" : "")}>
        <div>{review.paragraph_text}</div>
        <RadioButtonGroups/>
      </div>

      <div className="view">
        <div className="round">
          <input
            checked={review.is_labeled}
            type="checkbox"
            id={review.review_id}
          />
          <label htmlFor={review.id} />
        </div>



      </div>

    </li>
  );
};

export default ReviewItem;;
